script: |
  super -f text -I q6636.spq | sort > q6636.out

inputs:
  - name: q6636.spq
    data: |
      SELECT DISTINCT - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 + + - col1 - CAST ( - col0 AS INTEGER ) + + - 96 * - - CAST ( + col2 AS REAL ) <> NULL;
  - name: tab2

outputs:
  - name: q6636.out
    data: |
